@CTVVancouver Two hours after my booster I collapsed and was blue lighted 25 miles away and treated for a suspected Stroke (TIA)

CT scan, MRI scan, intravenous blood thinners and fluids.

Paralysis in my left cheek, leg and lower lip, unable to answer simple questions. #COVID19 #CovidVaccine

